}

.nav__item:last-of-type{
    border-bottom: none;
}

.nav__item > a {
    color: var(--color-dark);
}

.nav__toggler {
    opacity: 0.5;
    transition: box-shadow 0.15s;
    cursor: pointer;
  }

  @media screen and (min-width: 768px) {

    
      .nav__list {
        width: auto;
