/*animat*/

.svg-animat {
	font-family: "Cinzel", sans-serif;
	width: 100%; height: 100%;
}

.svg-text {
	animation: stroke 4s infinite alternate;
	stroke-width: .1;
	stroke: #F9F9F9;
	font-size: 44px ;
}
@keyframes stroke {
	0%   {
		fill: rgba(137,230,11,0); stroke: rgba(249,249,249,1);
		stroke-dashoffset: 25%; stroke-dasharray: 0 50%; stroke-width: .2;
	}
	70%  {fill: rgba(137,230,11,0); stroke: rgba(249,249,249,1); }
	80%  {fill: rgba(137,230,11,0); stroke: rgba(249,249,249,1); stroke-width: .3; }
	100% {
		fill: rgba(137,230,11,1); stroke: rgba(249,249,249,0);
		stroke-dashoffset: -25%; stroke-dasharray: 50% 0; stroke-width: 0;
	}
}
.wrapper {background-color:var()};


