.text-center{
 text-align: center;
  font-size: 4.6rem;

}

.shadow-prim{
  font-size: 4.6rem;
  text-shadow: var(--color-prim) 7px 6px ;
}

 .center{ 
  justify-content: center;
  text-align: center;
  justify-items: center;
}

 


/* QUOTES */
.quote {
  font-size: 5rem;
  font-family:"Satisfy", cursive ;
  color: var(--color-accent);
  line-height: 1.3;
  padding-top: -7rem ;

}

.quote-{
  background-color: var(--color-sec-accent);
  padding: 3rem 1rem ;
  border-radius: 50%;
}

.quote_move{
  margin-left: -6rem;
  margin-bottom: -9rem;

}



.quote__text::before {
  content: open-quote;
}

.quote__text::after {
  content: close-quote;
}

.quote__author {
  font-size: 2rem;
  font-weight: 500;
  font-style: normal;
  margin: 0;
}

.quote__organization {
  color: var(--color-headings);
  opacity: 0.4;
  font-size: 1.5rem;
  font-style: normal;
}

.quote__line {
  position: relative;
  bottom: 10px;
}

@media screen and (min-width: 1024px) {
  .quote {
    font-size: 2rem;
  }

  .quote__author {
    font-size: 2.4rem;
  }

  .quote__organization {
    font-size: 1.6rem;
  }

}


/* Testimonials */
.testimonial {
  padding: 3rem;
}

.testimonial .quote {
  margin: 2rem 0;
  font-size: 110%;
}

.testimonial__image {
  position: relative;
  margin: 0 3rem;
 
}

.testimonial__image img{
  width: 60%;
  padding: 1rem 4rem;
  

}

.testimonial__image > .icon-container {
  position: absolute;
  top: 3rem;
  right: -32px;
}

@media screen and (min-width: 375px) {
  .testimonial__image {
    margin: 0;
  }

  .testimonial .quote {
    margin: 5rem 0 0 6rem;
    font-size: 120%;
    line-height: 1.5;
  }
  .testimonial__image img {
    width: 90%;
    padding: 0 0;
  }
}

.btn-c{
  width: 100px;
  height: 100px;
  background-color: black;
  border-radius: 50% ;
  font-size: 3rem;
  cursor: pointer;
}

.btn-glow{
  box-shadow: 0 0 5px var(--color-third), 0 0 25px var(--color-third);
  color: var(--color-logo-blue);
  border: var(--color-third) solid 3px;
}
.btn-glow-red{
  box-shadow: 0 0 5px var(--color-red), 0 0 25px var(--color-red);
  color: var(--color-red);
  border: var(--color-red) solid 3px;
}
.btn-glow-green{
  box-shadow: 0 0 5px var(--color-logo-geen), 0 0 25px var(--color-logo-geen);
  color: var(--color-logo-geen);
  border: var(--color-logo-geen) solid 3px;
}

.btn-glow:hover{
  box-shadow: 0 0 5px var(--color-third),
  0 0 25px var(--color-third), 0 0 50px var(--color-third),
  0 0 100px var(--color-third), 0 0 200px var(--color-third);
}
.btn-glow-green:hover{
  box-shadow: 0 0 5px var(--color-logo-geen),
  0 0 25px var(--color-logo-geen), 0 0 50px var(--color-logo-geen),
  0 0 100px var(--color-logo-geen), 0 0 200px var(--color-logo-geen);
}

.btn-glow-red:hover{
  box-shadow: 0 0 5px var(--color-red),
  0 0 25px var(--color-red), 0 0 50px var(--color-red),
  0 0 100px var(--color-red), 0 0 200px var(--color-red);
}

.btn-glow:active{
color: var(--color-accent);
background-color: var(--color-third);
}

.btn-glow-red:active{
  color: var(--color-red);
  background-color: var(--color-red);
  }
.btn-glow-green:active{
  color: var(--color-logo-geen);
  background-color: var(--color-logo-geen);
  }

  @media screen and (min-width: 320px){
   .btn-c{
      width: 4rem;
      height: 4rem;
      background-color: black;
      border-radius: 50% ;
      font-size: 2rem;
      cursor: pointer;
    }  

  }

  @media screen and (min-width: 768px){
    .btn-c{
      width: 100px;
      height: 100px;
      background-color: black;
      border-radius: 50% ;
      font-size: 3rem;
      cursor: pointer;
    }
  }
  
