#calculator{
  font-family: "Cinzel", serif;
  background-color: black;
  border-radius: 15px;
  max-width: 650px;
  overflow: hidden;

}
#display{
  width:100% ;
  padding: 20px;
  font-size: 5rem;
  text-align: left;
  border: none ;
  background-color: var(--color-dark);
  color: var(--color-logo-geen);
}

#keys{
  display: grid;
  grid-template-columns: repeat(4,9rem);
  gap: 15px;
  padding: 30px;
}

@media screen and (min-width: 320px){
  #keys{
    display: grid;
    grid-template-columns: repeat(4,65px);
    gap: 3px;
    padding: 16px;
  }
}

@media screen and (min-width: 768px){
  #keys{
    display: grid;
    grid-template-columns: repeat(4,9rem);
    gap: 15px;
    padding: 30px;
  }
}
